const Product = ({post}) => {
  console.log("pratham")
  console.log({post})
  return (
    <div>
      <div>
        <p>{post.title}</p>
      </div>
      <div>
        <p>{post.description}</p>
      </div>
      <div>
        <p>{post.image}</p>
      </div>
    </div>
  );
};

export default Product;
